import React from 'react'
// import PropTypes from 'prop-types'
import "./style.css";
import { Navbar, NavItem } from "react-materialize"

function Nav(props) {
    return (
        <Navbar className="navbar" fixed="true" brand='Bryson Nelson' right>
            <NavItem className="navba-item" href='get-started.html'>About Me</NavItem>
            <NavItem href='components.html'>Contact Me</NavItem>
            <NavItem href='components.html'>Portfolio</NavItem>
        </Navbar>
    )
}

export default Nav
